                <div className="title">
                    <h1>{title}</h1>
                    <button className="close">X</button>
                </div>
                <div className="body"></div>
                <div className="footer">
                    <Button size={"md"}>Cancel</Button>
                    <Button size={"md"}>Add</Button>
                </div>
            </div>

        </div>



    );
}

export default Modal;
